node	service	0	7	7	und	0	Fjernpålogging fra Windows, Linux og Mac til Windows skrivebordet hjemmekontor.uib.no gir tilgang til flere standard Windows tjenester. En får automatisk tilgang til Windows hjemmekatalog, enhetens fellesområde, UiB fellesområde og standard programvare inkludert Microsoft Office.\r\n\r\nEr du utenfor UiB sitt nettverk må du først koble opp til UiB med VPN.\r\n\r\n\r\n\r\nWindows\r\nBruk programmet Remote Desktop Connection og oppgi hjemmekontor.uib.no i feltet for computer.\r\n\r\nLinux\r\nÅpne ett terminalvindu og skrive inn kommandoen \r\nrdesktop -k no -d UIB hjemmekontor.uib.no\r\n\r\nMac\r\n???\r\n	plain_text
