node	service	0	4	4	und	0	Her får alle ansatte tilgang til et felles lagringsområde der en kan lagre og lese filer og dokumenter.  \r\nPå Windows pc'er som er satt opp av IT-avdelingen, vil du finne dette som disk P:\\\r\n\r\nHvis ansatte bytter arbeidssted eller trenger tilgang til et annet fellesområde, kan du søke om å få tilgang til den nye enhetens fellesområde ved å søke via https://sebra.uib.no. \r\n\r\nStudenter kan også søke om å få tilgang til avgrensede fellesområder, som for eksempel forskergrupper. I tilfellet må studentene ta kontakt med instituttet og få administrasjonen der til å søke på deres vegne. 	plain_text
