node	service	0	18	19	und	0	Ønsker du en nettsted, nettsider, enten for å presentere deg selv på nett, eller for din organisasjonen eller din forskningsgruppe? \r\n\r\nIT avdelingen drifter flere ulike verktøy som gjør det mulig for ansatte og studenter å publisere informasjon på Internett. Blant annet drifter IT-avdelingen en multisite-versjon av Wordpress hvor alle kan bestille sin egen Wordpress instans.\r\nWordPress er et av de mest brukte publiseringssystemene for web. Et publiseringssystem kalles ofte på engelsk for CMS (content management system) og WordPress er et slik CMS system.\r\n\r\nNoen ønsker derimot å lage nettsidene og nettstedet sitt selv ved å utvikle html kode og css (cascading style sheet). Da tilbyr vi en tilgang til en katalog på standard Linux Redhat server med Apache webtjener installert.\r\n\r\nOm en ønsker å drifte en egen løsning med PHP og Mysql/Postgresql, tilbyr vi også tilgang til Linux Redhat server med Apache og PHP samt tilgang til ønsket database.\r\n\r\n\r\n\r\n<s>Merk at denne tjenesten tilbys kun for nettsider som ikke naturlig faller under «Eksternweben», som er UiB sin offisielle nettprofil. Dette er nettsider som faller under navnet rommet: www.uib.no.\r\n\r\nSom eier av en nettside, også gjerne kalt «blogg» på b.uib.no får du en administratorkonto med mulighet for å legge til brukere selv og tildele disse forskjellige nivåer av rettigheter i din blogg. I tillegg har du mulighet til å velge blant forhåndsinstallerte temaer og tillegg (kalt på engelsk: “plugins”.)\r\n\r\nWordPress ble valgt fordi det har en stor grad av fleksibilitet angående tilpasning av utseende og funksjonalitet. Du kan benytte tradisjonelt bloggformat som presenterer innhold i omvendt kronologisk rekkefølge (altså nyeste innhold øverst), eventuelt velge å presentere innhold som forskjellige «sider» dersom du har mest statisk innhold.</s>	plain_text
node	service	0	16	17	und	0	Det utføres prosjekt med deltakere fra IT-avdelingen og miljø for spesifisering av kontaktsenterløsning med talemeldinger, tastemenyer og arbeidsflyt.  Etter ferdig prosjekt vil avdelingens telefonnummer ha køordning der samtaler sendes til innloggede saksbehandere hos avdelingen etter spesifiserte regler.	plain_text
node	service	0	4	4	und	0	Her får alle ansatte tilgang til et felles lagringsområde der en kan lagre og lese filer og dokumenter.  \r\nPå Windows pc'er som er satt opp av IT-avdelingen, vil du finne dette som disk P:\\\r\n\r\nHvis ansatte bytter arbeidssted eller trenger tilgang til et annet fellesområde, kan du søke om å få tilgang til den nye enhetens fellesområde ved å søke via https://sebra.uib.no. \r\n\r\nStudenter kan også søke om å få tilgang til avgrensede fellesområder, som for eksempel forskergrupper. I tilfellet må studentene ta kontakt med instituttet og få administrasjonen der til å søke på deres vegne. 	plain_text
node	service	0	14	15	und	0	For å få opprettet en ny ansatt konto må en søke om konto på sebra.uib.no, bruk funksjonen Opprett konto. Søknaden går til godkjenner på den enkelte enhet. Følg prosedyrene som er oppgitt på sebra.uib.no\r\nDet er hovedsakelig godkjenner på de enkelte enhetene som foretar all administrering av kontoer. Dette gjelder også tilganger til fellesområder og glemt å bytte passord.\r\n\r\nAnsattkonto inkluderer følgende\r\n- e-post konto\r\n- Windows hjemmeområde\r\n- Unix hjemmeområde\r\n\r\n- Tilgang til:\r\n      - sikkert trådløst nettverk\r\n      - enhetens fellesområder\r\n      - UiB fellesområde, \r\n      - programvare som har «site» lisenser\r\n      - utskrifttjenester for ansatte\r\n      - ansatt brukerstøtte\r\n      - fjernpålogging \r\n      - VPN pålogging til UiB\r\n	plain_text
