51	Administrasjonsmeny-modulen gir en rullegardinmeny arrangert for en- eller to-klikkstilgang til de fleste administrative oppgave og andre vanlige mål (for brukere med passende rettigheter). Bruk innstillingene nedenfor for å tilpasse menyens utseende.	nb	0	0	0
52	Administrasjonsmeny-modulen tilbyr en rullegardinmeny arrangert for en- eller to-klikkstilgang til de fleste administrative oppgaver og andre vanlige mål (for brukere med passende tillatelser). Den viser også antall anonyme og registrerte brukere, og gjør det mulig for andre moduler å definere egne menyelementer. Integrering med menyen varierer fra modul til modul; for eksempel bruker tilleggsmodulen <a href="@drupal">Devel</a> administrasjonsmenyen mye for å tilby rask tilgang til utviklingsverktøy.	nb	0	0	0
53	På <a href="@settings">innstillingssiden</a> til administrasjonsmenyen kan du styre hvordan menyen ser ut og oppfører seg. Større forandringer i utseendet krever at du forandrer på utseendemalen og CSS-filene til nettstedet ditt. Se README.txt-fila til modulen for mer informasjon om utseendemal og CSS-tilpasninger.	nb	0	0	0
54	Menyelementene som vises i administrasjonsmenyen avhenger av brukerens tillatelser. For det første så vises administrasjonsmenyen kun for brukere i roller med (admin_menu-modul) tillatelsen <em>Tilgang til administrasjonsmeny</em>. For det andre så må brukeren være medlem av en rolle med (system-modul) tillatelsen <em>Aksessere administreringssider</em> for å kunne se administrative lenker. Og for det tredje så vises bare nåværende tillatte lenker; for eksempel, hvis en bruker ikke er medlem av en rolle med (bruker-modul) tillatelsene <em>Administrer tillatelser</em> og <em>Administrere brukere</em>, vil ikke menyelementet <em>Brukeradministrering</em> vises.	nb	0	0	0
