3500	Med PHP-filteret kan brukere med de rette tilgangene legge ut sin egen PHP-kode på sidene. Dette er en kraftig og fleksibel egenskap som kan gis til brukere med gode PHP-kunnskaper, som administratorgruppa har tillit til. Samtidig er det en stor og farlig sikkerhetsrisiko hvis en bruker med onde hensikter får tilgang til egenskapen. Også brukere man har tillit til kan ved inkurie sette nettstedet ut av spill ved å legge ut feilskrevet PHP-kode. Kun de brukerne man stoler aller mest på bør få tilgang til å bruke PHP-filteret, og all PHP-kode som legges til gjennom filteret bør leses nøye gjennom før den blir lagt ut. Du kan finne <a href="@php-snippets">eksempler på PHP-kode</a> på Drupal.org.	nb	0	0	0
